    [],nt"revision_timestamp": "2015-05-06T21:25:01.550546",nt"name": "automated-analysis-of-imaging-based-experiments-project-6fd20",nt"isopen":
    true,nt"url": null,nt"notes": "For many applications involving liquid injection,
    the ability to predict the details of the breakup process is often limited due to
    the complexity of the two-phase phenomena. Likewise, the ability to experimentally
    characterize these phenomena is also limited due in part to the need to rely upon
    visualization tools which are inherently qualitative. As a result, the ability to
    validate predictions using these diagnostic tools is also limited. In recent years,
    visualization diagnostics have evolved substantially in terms of spatial and temporal
    resolution. The advancements, coupled with a tool to conveniently quantify the results
    obtained relative to the breakup process offer the potential for a marked increase
    in understanding of this phenomenon. The proposed effort will develop such a tool
    that will be applied to the problems of pressure swirl injectors and liquid injection
    into a crossflow. The typical characteristics associated with this type of liquid
    breakup, such as column/sheet flattening, bending, fracture point, dynamics, etc.
    will be automatically quantified using the tool proposed. The project will utilize
    existing results obtained with state-of-the-art high speed imaging, but will acquire
    limited data as well to validate the tools developed.  Comparisons with advanced
    CFD modeling will be made to demonstrate the application of the software developed.rn",nt"license_title":
